/**
 * Multiplies two numbers
 *
 * @param data
 * @param x
 *
 * @example
 * ```
 * multiply(3, 5);     // 15
 * ```
 *
 * @category Math
 */
export declare function multiply(data: number, x: number): number;
/**
 * @param x
 *
 * @example
 * ```
 * multiply(3)(5);     // 15
 * ```
 *
 * @category Math
 */
export declare function multiply(x: number): (data: number) => number;
